import React, {Component} from 'react';
import {Button, Col, Grid, Row} from "react-bootstrap";
import {Link} from "react-router-dom";
import Responsive from '../ICONS/Responsive';
import Webdev from '../ICONS/Webdev';
import Social from '../ICONS/Social';

class ServiceAboutHome extends Component {
    render() {
        return (
                <div className="service-home">
                    <Grid>
                        <Row className="weetjes">
                            <Col><h1 className="service-home-head">
                                Over Mellowwebdesign
                            </h1></Col>
                            <Col xs={12} md={4} className="service-tile">
                                <div className="icon-margin1">
                                    <Responsive/>
                                </div>
                                <h2>Webdesign</h2>
                                <p>Websites maken is onze eerste grote liefde maar ook een stijlvol grafisch ontwerp van jouw
                                    <a href="/grafisch-ontwerp/logo-ontwerp/" title="Logo ontwerp in Brugge">logo</a> is bij Mellow in goede
                                    handen. </p>

                            </Col>
                            <Col xs={12} md={4} className="service-tile">
                                <div className="icon-margin">
                                    <Webdev/>
                                </div>
                                <h2>Webdevelopment</h2>
                                <p> Landingspagina's, website, webshops ... Noem maar op, wij kunnen het maken voor jou!</p>
                            </Col>
                            <Col xs={12} md={4} className="service-tile">
                                <div className="icon-margin">
                                    <Social/>
                                </div>
                                <h2>Social media</h2>
                                <p> Ik zou hier liever iets hebben met betrekking tot SEO /SEA , waar we sterker in zijn + meer in doen.</p>
                            </Col>
                        </Row>
                        <Link to="/contact"/>
                    </Grid>
                </div>
        );
    }
}

export default ServiceAboutHome;
